import React from 'react';
import { BrowserRouter as Router, Route, NavLink, Switch } from 'react-router-dom';
import AllTodosIds from './component/AllTodosIds';
import AllTodosIdsAndTitles from './component/AllTodosIdsAndTitles';
import AllUnresolvedTodos from './component/AllUnresolvedTodos';
import AllResolvedTodos from './component/AllResolvedTodos';
import AllTodosIdsAndUserIds from './component/AllTodosIdsAndUserIds';
import AllResolvedTodosAndUserIds from './component/AllResolvedTodosAndUserIds';
import AllUnresolvedTodosAndUserIds from './component/AllUnresolvedTodosAndUserIds';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <ul>
            <li>
              <NavLink exact to="/">Todos IDs</NavLink>
            </li>
            <li>
              <NavLink to="/all-todos-ids-and-titles">Todos IDs and Titles</NavLink>
            </li>
            <li>
              <NavLink to="/all-unresolved-todos">Unresolved Todos</NavLink>
            </li>
            <li>
              <NavLink to="/all-resolved-todos">Resolved Todos</NavLink>
            </li>
            <li>
              <NavLink to="/all-todos-ids-and-userids">Todos IDs and User IDs</NavLink>
            </li>
            <li>
              <NavLink to="/all-resolved-todos-and-userids">Resolved Todos and User IDs</NavLink>
            </li>
            <li>
              <NavLink to="/all-unresolved-todos-and-userids">Unresolved Todos and User IDs</NavLink>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route exact path="/" component={AllTodosIds} />
          <Route path="/all-todos-ids-and-titles" component={AllTodosIdsAndTitles} />
          <Route path="/all-unresolved-todos" component={AllUnresolvedTodos} />
          <Route path="/all-resolved-todos" component={AllResolvedTodos} />
          <Route path="/all-todos-ids-and-userids" component={AllTodosIdsAndUserIds} />
          <Route path="/all-resolved-todos-and-userids" component={AllResolvedTodosAndUserIds} />
          <Route path="/all-unresolved-todos-and-userids" component={AllUnresolvedTodosAndUserIds} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
